	 outputs.current_job_start_date = new ImportSetUtilsSNC().getConvertedDate(inputs.job_tracker.getValue('job_started_at'));
    outputs.current_job_start_date_time = new ImportSetUtilsSNC().getConvertedDateTime(inputs.job_tracker.getValue('job_started_at'));
})(inputs, outputs);

